import { TradeAction, TRADE } from "./types";

export function trade(
  entityId: string,
  playerName: string,
  givenResources: string,
  getResources: string,
): TradeAction {
  return {
    type: TRADE,
    entityId,
    playerName,
    form:{
      givenResources,
      getResources,
    },
  };
}
